  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments from August through October
  of 1940. The report begins by summarizing the weather conditions. Wildlife- including
  migratory birds, big game animals, furbearers, predators, rodents, and fish- is
  also covered. The Refuge development and maintenance section discusses physical
  developments. The public relations section of the report describes recreational
  uses. Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
